import React, { useState, useEffect } from 'react';
import AppBar from '@mui/material/AppBar';
import Toolbar from '@mui/material/Toolbar';
import TextField from '@mui/material/TextField';
import IconButton from '@mui/material/IconButton';
import SearchIcon from '@mui/icons-material/Search';
import Grid from '@mui/material/Grid';
import UserProfileCard from './UserProfileCard'; // Import custom component
import { ThemeProvider } from '@mui/material/styles';
import theme from './theme'; // Optional for custom theme

function App() {
  const [userData, setUserData] = useState({});

  useEffect(() => {
    fetch('https://mocki.io/v1/ddb7e0a8-e218-4e36-b1be-b902cdb1c098')
      .then((response) => response.json())
      .then((data) => setUserData(data))
      .catch((error) => console.error('Error fetching data:', error));
  }, []);

  return (
    <ThemeProvider theme={theme}>
      <AppBar position="static">
        <Toolbar>
          <TextField id="search" label="Search" type="search" sx={{ mr: 2 }} />
          <IconButton color="inherit" aria-label="search">
            <SearchIcon />
          </IconButton>
        </Toolbar>
      </AppBar>
      <Grid container spacing={2} sx={{ px: 2 }}>
        {userData &&
          Object.entries(userData).map(([key, value]) => (
            <Grid item xs={12} key={key}>
              <UserProfileCard key={key} label={key} value={value} />
            </Grid>
          ))}
      </Grid>
    </ThemeProvider>
  );
}

export default App;
